import React from 'react';
import ManagerLayout from '../components/ManagerLayout';
import '../styles/Table.css'; // Keeping for potential future table
import { FaPlus, FaEdit, FaTrashAlt, FaSearch, FaUpload } from 'react-icons/fa';

function ManagerInventory() {
  return (
    <ManagerLayout pageTitle="Inventory">
      <div className="page-actions-bar">
        <button className="button button-primary"><FaPlus /> Add Item</button>
        <div className="search-bar">
          <input type="text" placeholder="Search Inventory..." />
          <button className="icon-button"><FaSearch /></button>
        </div>
      </div>
      <p>Inventory page content goes here...</p>
    </ManagerLayout>
  );
}

export default ManagerInventory;
